import React from 'react';

const GenerateTrendingJSON = () => {
  const arrTrending = []
  const [objTrending, storeTrending] = React.useState('')
  React.useEffect(() => {
      const cURL = 'https://api.coingecko.com/api/'
      fetch(`${cURL}v3/search/trending`)
          .then(response => response.json())
          .then(json => storeTrending(json))
  },[])

  for (const coins in objTrending) {
    arrTrending?.push(Object.keys(objTrending)[coins])
  }
  console.log(arrTrending)
  return arrTrending
}

export default GenerateTrendingJSON
